import axios from "axios";
import React, { useState } from "react";
import { toast } from "react-toastify";

function  PersonInfo(){
    const [requestList, setRequestList] = useState([])
    const [requestList2, setRequestList2] = useState([])

    function start(){
        axios.get('http://localhost:3001/api/Person/personinfo', {
            headers:{
                accessToken2: sessionStorage.getItem('accessToken2'),
            }
        }).then((response)=>{
            if(response.data.error){
                toast.error('user not authenticated')
            }else{
                // toast.success('Info fetched')
                setRequestList(response.data)
            }
        })

    }
    function start1(){
        axios.get('http://localhost:3001/api/Person/personcontact', {
            headers:{
                accessToken2: sessionStorage.getItem('accessToken2'),
            }
        }).then((response)=>{
            if(response.data.error){
                toast.error('user not authenticated')
            }else{
                // toast.success('Info fetched')
                setRequestList2(response.data)
            }
        })


    }

    start()
    start1()

    return (

        <div>
            <div id="main1">
            <div id="heading">
                <h1 >Person Details</h1>
            </div>
            
            </div>
        {
            requestList.map((val,key)=>{
                return (
                    
                    <div className="requests">
                        
                        <div>
                            <div className="main">
                            <h1>Cnic : {val.cnic}</h1>
                            <h1 id="reqid">Blood Group: {val.blood_group}</h1 >
                            </div>
                            <h3>Name: {val.fname + " " + val.lname}</h3>
                            <h3>Weight: {val.weight}</h3>
                            <h3>No. of times Donation: {val.frequencyDonation}</h3>
                            <h3>IsDiabetes?: {val.IsDiabetes}</h3>
                            <h3>IsHypetitus?: {val.IsHypetitus}</h3>
                          


                        </div>

                    </div>
                );
            })
        }
    {
            requestList2.map((val,key)=>{
                return (
                    
                    <div className="requests">
                        
                        <div>
                            <div className="main">
                            <h1>Contact no 1 : {(key+1) + " "+val.contactno}</h1>
                            
                            </div>
                        </div>

                    </div>
                );
            })
        }
       
        </div>
    );


    

}

export default PersonInfo;
